import React, {Component} from 'react';

class ProfilePreview extends Component {
    render() {
        return (
            <div className="profile">
                <h1 className="name">Baby</h1>
                <img className="profile-pictures" alt="" />
                <p className="about">I'm looking for someone to feed me, open the door when I need it, and give snuggles.</p>
                <div className="character-badges">
                    <span className="badge">Meow! (I'm a talker!)</span>
                </div>
            </div>
        )
    }
}

export default ProfilePreview;
